import { CloseCircle } from '@enbdleap/react-icons';
import { Avatar, Box, Button, Div, Flex, HeaderResponsive, IconButton, LeftPanel, Link, MenuItem, MenuList } from '@enbdleap/react-ui';
import React, { useState } from 'react';
import ConfirmationDialog from './ConfirmationDialog';
import { Navigate, redirect, useNavigate } from 'react-router-dom';
// import LoginStore from 'login/LoginStore';
import {enbdLogo} from "../assets/enbd_logo.svg"
import { infoStore } from '../redux/store/infoStore';

export const Header: React.FC = () => {
    const [activeLink, setActiveLink] = useState('Home');
    const [openLogout, setOpenLogout] = useState<boolean>(false);
    const [openConfirmation, setOpenConfirmation] = useState<boolean>(false);
    const [anchorEl, setAnchorEl] = useState<null | HTMLElement>(null);
    const open = Boolean(anchorEl);
    const navigate = useNavigate();
    const handletabClick = (link) => {
        setActiveLink(link);
      };
      const linkStyle = (link) => ({
        color: activeLink === link ? '#012970' : 'black',
        borderBottom: activeLink === link ? '2px solid #012970' : 'none',
        padding: '5px 10px',
        cursor: 'pointer'
      });
    const handleClick = (event: React.MouseEvent<HTMLButtonElement>) => {
        setAnchorEl(event.currentTarget);
    };

    const handleClose = () => {
        setAnchorEl(null);
        setOpenLogout(!openLogout);
    };

    const handleProfileClick = (event) => {
        if (openLogout) {
            setAnchorEl(null);
        }
        else {
            setAnchorEl(event.currentTarget);
        }
        setOpenLogout(!openLogout);
    }

    const handleConfirmLogout = async () => {
        //Logout Redirect Logic here
        console.log("confirm");


        // TODO dispatch
        try {
            const result = await fetch('http://localhost:8080/auth/logout', {
                method: 'POST',
                headers: { 'Content-Type': 'application/json', 'Authorization': `Bearer ${infoStore.getAccessToken('jwtToken')}` },
                body: JSON.stringify({
                    userId: 'userid',
                })
            });

            setOpenConfirmation(false);
            infoStore.deleteAccessToken('jwtToken');
            infoStore.deleteAccessToken('accessToken');
            navigate("/login?logout=success");

        } catch (e: any) {
            console.log(e || "Something Went Wrong");
            return;
        }
    }

    const handleCancelLogout = () => {
        console.log("cancel");
        setOpenConfirmation(false);
    }

    return (
        <>
            <HeaderResponsive
                root={{
                    elevation: 0,
                    position: 'relative',
                    sx: {
                        background: 'white',
                        boxShadow: '0 4px 2px -2px #00000020'
                    }
                }}
                slots={{
                    logo: <>
                        {/* <Box> <EI_LOGO /></Box> */}
                        <Box> <ENBD_LOGO/></Box>
                    </>,
                    menu:
                    <Flex direction='row' gap={1}>
                    <Link href='accounts' onClick={() => handletabClick('Home')}>
                      <MenuItem style={linkStyle('Home')}>Home</MenuItem>
                    </Link>
                    <Link href='telegraphic-bank-transfer' onClick={() => handletabClick('Payments')}>
                      <MenuItem style={linkStyle('Payments')}>Payments</MenuItem>
                    </Link>
                    <Link href='accounts' onClick={() => handletabClick('Pending Activities')}>
                      <MenuItem style={linkStyle('Pending Activities')}>Pending Activities</MenuItem>
                    </Link>
                    <Link href='accounts' onClick={() => handletabClick('Account Services')}>
                      <MenuItem style={linkStyle('Account Services')}>Account Services</MenuItem>
                    </Link>
                  </Flex>,
                    toolbar: <><Avatar onClick={handleProfileClick}
                        variant='rounded'>
                        <svg width="24" height="24" viewBox="0 0 24 24" fill="none" xmlns="http://www.w3.org/2000/svg">
                            <path d="M15.8029 13.5C18.4328 15.3894 19.5 17.5211 19.5 21.5H4.5C4.5 17.5211 5.56721 15.3894 8.19714 13.5M16.5 8C16.5 10.4853 14.4853 12.5 12 12.5C9.51472 12.5 7.5 10.4853 7.5 8C7.5 5.51472 9.51472 3.5 12 3.5C14.4853 3.5 16.5 5.51472 16.5 8Z" stroke="#6A3787" strokeLinecap="round" strokeLinejoin="round" />
                        </svg>
                    </Avatar>
                        <MenuList sx={{ p: 0 }}>
                            <LeftPanel
                                anchorEl={anchorEl}
                                open={openLogout}
                                items={[{
                                    label: 'Logout',
                                    icon: ''
                                }]}
                                onClick={() => { setOpenConfirmation(true) }}
                                onClose={handleClose}
                                sx={{
                                    p: 0
                                }}
                                MenuListProps={{
                                    'aria-labelledby': 'basic-button',

                                }}
                            />
                        </MenuList>

                    </>,
                    mobileMenu:
                        <Flex direction='column' gap={1}>
                            <Link href='accounts'><MenuItem>Home</MenuItem></Link>
                        </Flex>,
                    mobileToolbar:
                        <Flex>
                            <Button size='medium'> Sign In </Button>
                        </Flex>,
                }}
                // menuIcon={<Div background='primary'> [menuIcon] Menu Icon </Div>}
                // closeIcon={
                //     <IconButton>
                //         <CloseCircle />
                //     </IconButton>
                // }
                slotProps={{}}
                container={{}}
                divider={true}
            />
            <ConfirmationDialog
                open={openConfirmation}
                message='Are you sure you would like to log out?'
                title='Confirm Logout'
                cancelButtonText='Cancel'
                confirmButtonText='Confirm'
                onConfirm={handleConfirmLogout}
                onCancel={handleCancelLogout}
            />
        </>
    )
}

export default Header



